import React from 'react';
import {
  PageHeader,
  Typography,
  Row, Col,
} from 'antd';

const { Title, Text } = Typography;
const routes = [
  {
    path: 'index',
    breadcrumbName: 'Estudiante',
  },
  {
    path: 'first',
    breadcrumbName: 'Home',
  },
];

class PrincipalEstudiante extends React.Component {
  render() {
    return (
      <div>
        <Row>
          <Col><PageHeader title={<Title level={3}>Bienvenido al Menu Estudiante</Title>} breadcrumb={{ routes }} /></Col>
        </Row>
        <Col><Text>Ant Design</Text></Col>        
        <br />
      </div>
    )
  }
}

export default PrincipalEstudiante;
